INSERT INTO `mass` (`id`, `subject`, `content`, `created`, `updated`) VALUES
(1, 'Promotion 2013', '<p>The&nbsp;Action&nbsp;view helper enables view scripts to dispatch a given controller action; the result of the response object following the dispatch is then returned. These can be used when a particular action could generate re-usable content or &quot;widget-ized&quot; content.</p>\r\n\r\n<p>Actions that result in a&nbsp;_forward()&nbsp;or redirect are considered invalid, and will return an empty string.</p>\r\n\r\n<p>The&nbsp;API&nbsp;for the&nbsp;Action&nbsp;view helper follows that of most&nbsp;MVC&nbsp;components that invoke controller actions:&nbsp;<strong>action($action, $controller, $module = null, array $params = array())</strong>.&nbsp;<var>$action</var>&nbsp;and&nbsp;<var>$controller</var>&nbsp;are required; if no module is specified, the default module is assumed.</p>\r\n', '2014-06-30', '2014-07-01 08:08:16'),
(5, 'Promotion 2014', '<p>This is a new arrival dogo want its customer to know about&nbsp;</p>\r\n\r\n<p>In addition to its standard function as a marketplace, a forum was a gathering place of great social significance, and often the scene of diverse activities, including political discussions and debates, rendezvous, meetings, et cetera. In that case it supplemented the function of a&nbsp;<a href="http://en.wikipedia.org/wiki/Conciliabulum">conciliabulum</a>.</p>\r\n', '2014-07-01', '2014-07-01 07:29:32'),
(6, 'Chin is in promotion', '<p>hello, i am from taiwan</p>\r\n', '2014-07-03', '2014-07-03 03:24:33');
