INSERT INTO `products` (`id`, `v_id`, `product_id`, `name`, `description`, `picture`, `subcategories`, `r_price`, `w_price`, `o_price`, `active`, `new`, `pre_order`, `on_sale`, `updated`, `created`) VALUES
(1, NULL, '32010', 'Mini Skirt Sanitary Pants', '\r\n<span style="font-size: 9pt; color: black;">Uh-oh it is?that time of the season again. Keep your little princess clean and pretty with the mini sanitary skirt. Skirt and sanitary cover are seperate pieces and can be detached. Sanitary pads can be bought in major pet stores. <!--?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /--><o:p /></span>\r\n<p><br /></p>\r\n\r\n', 'sanitary-mini-skirt-cloth.jpg', 'Special FUN Wear', 0, 11, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(2, NULL, '55010', 'Holiday Party Attire', 'Taking your beloved pooch to a party this Christmas?  Make sure she goes in style in the Holiday Party Attire.  A soft padded lining will keep your pet comfortable - while on the outside, the real fun begins with a shiny gold bowtie belt that wraps around a one-of-a-kind glittery Christmas fabric.  This special design brings out the liveliest of holiday spirits and guarantees to standout in any party crowd.\r\n\r\nSizes: XS, S, M, L, XL.', 'holiday-attire-dog-1.jpg', 'Special FUN Wear', 0, 9, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(3, NULL, '71050', 'Classic Manhattan Coat', 'Perfect blend of trendy and conservative. This classic coat has a belt wrap around the stomach. Pink leather trims, with Velcro closures. Sizes: XS, S, M, L, XL.', 'manhattan-coat-dog-1.jpg', 'Winter Coats', 0, 12, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(4, NULL, '74010', 'Moscow Fur Coat', 'Moscow Fur Coat is one of DOGO''s most popular winter coats. Suede fabric with faux fur. Zipper at the front with 2 side Velcro Closures. Great fit and look!\r\n*New Lavender Purple Moscow Coat avaliable now*\r\n\r\nColors: Light Green,Amber Brown,Lavender Purple.\r\nSizes: XS, S, M, L, XL.', 'moscow-fur-coat-new0.jpg', 'Winter Coats', 0, 16.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(5, NULL, '33016', 'Go Camouflage ', '<span style="WIDOWS: 2; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,249,244); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 12px/18px Arial, Helvetica, sans-serif; WHITE-SPACE: normal; ORPHANS: 2; FLOAT: none; COLOR: rgb(68,68,68); WORD-SPACING: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">Our Go Camouflage coat is water-resistant with quilted inner lining. It is easy to wear with adjustable Velcro closure at neck and stomach and a convenient leash hole. With this coat, your pet can hide in the jungle or be the spotlight on the streets!</span> ', 'Go-Camouflage-2.jpg', 'Raincoats', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(6, NULL, '042010', 'Rhinestone Personality Collar', 'The Rhinestone Personality Collection is made of high quality leather designed for great looks, and to be used as an everyday collar/leash. Each collar and leash can be customized by you with our bling bling rhinestones. Just slide it on and put the belt in place; it can be done in less than a minutes! Colors: Green, Black, Pink, and Red. Size Length Width XS 7-9.5 1/2&quot; S 9-12&quot; 1/2&quot; M 11.5-14.5&quot; 3/4&quot; L 14-18&quot; 3/4&quot; ', 'personality-collar0.jpg', 'Collar.Harness.Lead', 0, 8, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(7, NULL, '052010', 'Rhinestone Personality Leash', 'The Rhinestone Personality Collection is made of high quality leather designed for great looks, and to be used as an everyday collar/leash.  Each collar and leash can be customized by you with our bling bling rhinestones.  Just slide it on and put the belt in place; it can be done in less than a minutes!  \r\nColors: Green, Black, and Pink.\r\nSize   Length   Width\r\nS   4"   1/2"\r\nL   4"   3/4"\r\n', 'personality-lead-1.jpg', 'Collar.Harness.Lead', 0, 11, 0, 0, 0, 0, 0, '2014-07-17 06:36:20', '2014-07-17 06:36:20'),
(8, NULL, '051021', 'Rhinestone Hearts and Stars', '<P> </P>\r\n<P>Rhinestone Hearts and Stars sold seperately. Each style includes 5 pieces per bag.  (10mm)</P>\r\n<P><A href="http://www.dogodesign.com/frame_showone_al.asp?pid=407&rootid=2&id=24"><FONT color=#ff66cc>Click here for pink and blue rhinestone</FONT></A><FONT color=#ff66cc>.</FONT></P>', 'Rhinestone Hearts & Stars 1.jpg', 'Rhinestones', 0, 4, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
