(11, NULL, '043010', 'Bone/ Paw/ Heart Harness', 'Standard leather harness with different ornaments for each color - Pink w/heart, Black w/paw, and Green w/bone. ', 'DOGO-Harness.jpg', 'Collar.Harness.Lead', 0, 3.95, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
(12, NULL, '05000', 'Rhinestone Alphabets Thin', 'Introducing our new thin rhinestone letters.  These sexy letter are made lighter and will fit on to any DOGO rhinestone compatilbe collar or leads.  ', 'Thin-Rhinestone-Letters.jpg', 'Rhinestones', 0, 3.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
(13, NULL, '77020', 'Alpine Snow Jacket V.2', '\r\n<div>Our most popular coat is now even better. Introducing Alpine Snow Jacket V.2. The new jacket is puffier than before and it has an attachable hood via zippers. Also new is the addition of the ever popular pink color. </div>\r\n', 'pink-alpine-w-dog.jpg', 'Winter Coats', 0, 16.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
