(15, NULL, '041030', 'Rhinestone Leather BLING', 'We have added even more rhinestones to the buckle of the collar for an even greater bling bling effect!  The collar is designed to be decorative and not for walking the dog.  Avaliable Colors: Black, Pink, Red, and Blue. ', 'Rhinestone-leather-bling.jpg', 'Collar.Harness.Lead', 0, 3.25, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
