(19, NULL, '83310', 'Army Camo Raincoat', '<p><span style="FONT-FAMILY: ??,Verdana,Arial; COLOR: black; FONT-SIZE: 9pt"><span style="mso-fareast-language: ZH-TW">The army camo raincoat uses Velcro straps along the bottom which results in easy to wear and great coverage from chest to stomach. <span style="mso-spacerun: yes"><span style="FONT-FAMILY: ??,Verdana,Arial; COLOR: black; FONT-SIZE: 9pt; mso-fareast-language: ZH-TW">Leash whole is also available. Please note: dark green is the current updated version.</span></span></span></span></p><p><span style="FONT-FAMILY: ??,Verdana,Arial; COLOR: black; FONT-SIZE: 9pt"><span style="mso-fareast-language: ZH-TW"><span style="mso-spacerun: yes"><span style="FONT-FAMILY: ??,Verdana,Arial; COLOR: black; FONT-SIZE: 9pt; mso-fareast-language: ZH-TW">MSRP $32.00</span></span></span></span></p>', 'Army Raincoat GN (dog).jpg', 'Raincoats', 0, 12.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:21', '2014-07-17 06:36:21'),
