(26, NULL, '66110', 'Army Jacket', '<p>One of the best selling outerwear, the Army Jacket is now available in desert style! Faux fur hood with camouflage lining, the coat can easily be worn reversibly with Velcro closure. Leash hole included.</p><p>MSRP $48.00</p>', 'Army Jacket BG(dog).jpg', 'Winter Coats', 0, 19, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
(27, NULL, '34010', 'Pom Pom Santa', '\r\nClassic Style of Santa coat with more pom pom to creat a fun and holiday spirit. This coat is not only adorable but also keeps your dog warm and comfy. Velcro closure with leash hole. \r\n', 'pompom-santa-coat-dog10.jpg', 'Special FUN Wear', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
(28, NULL, '41010', 'French Terry Hoodie 2-PC', '\r\nThis 2-pc is made with soft french terry with white stripe and trim detail. Pink heart on the pant pocket and pink heart hoodie pompom makes this outfit even more adorable. The sweatshirt can be worn together with the pant or just by itself. This is this winter''s hottest look for the sporty chic poochies. Leash hole.\r\n\r\nNow available in black!\r\n\r\n\r\n', 'terry-2pc-dog10.jpg', 'Sweatshirt & Jumper', 0, 16.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
(29, NULL, '33110', 'Winter Furry Harness', '\r\n<p>Combined with high fashion and functionality, this winter vest is a must have item. Line with faux fur for warmth and style, the harness vest is secured tightly with Velcro strip, buckle, and double D-rings for leash. </p><p>MSRP $40.00</p>\r\n', 'Winter Furry Harness DN (dog).jpg', 'Harness Vest', 0, 17, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
