(31, NULL, '53110', 'SharkDog Sweatshirt', '\r\n<p>Our most popular hoodie is a must have item for all the little wanna be tough dogs! The soft cotton sweatshirt features a detailed shark hood w/fin, and matching white trims. It might just scare off some big dogs! </p><p>MSRP $36.00</p>\r\n\r\n', 'sharkdog-hoody-dog-1.jpg', 'Special FUN Wear', 0, 15.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
(32, NULL, '57011', 'Bunny Shirt and Hat V.2', '\r\nBunny Shirt version 2.0! Imporved big bunny ears with built in wire so it stands up high just like the real bunnies do!  \r\n', 'bunny-shirt-&-hat-with-dog1.jpg', 'Special FUN Wear', 0, 11, 0, 0, 0, 0, 0, '2014-07-17 06:36:22', '2014-07-17 06:36:22'),
