(46, NULL, '052210', 'Flower Leash', '<FONT face=Verdana>A perfect matching leash for the Flower Collar or Rhinestone Personality Collars, the Flower Leash is decorated with six rhinestone dotted flowers three on the bottom and three by the handle.   Measures 4ft long, and .5 inch wide.</FONT>', 'flower-leash-pink-2.jpg', 'Collar.Harness.Lead', 0, 7.45, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
