(48, NULL, '054010', 'DG Leash', 'A matching leash for DG Collar, Harness, and DG Harness Vest.  The contemporary DG leash is made of strong nylon and quality metal hardware.  4 feet long, .6 inch wide. ', 'DG-Leash0.JPG', 'Collar.Harness.Lead', 0, 4.8, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(49, NULL, '08110', 'DG Harness', '<p>A contemporary mix of stripes constructed with strong nylon and quality hardware. Size is adjustable by the neck and girth - easily worn with chrome plated quick release buckle. Fits nice, and looks great! </p><p><table border="0" cellspacing="0" cellpadding="0" width="172"><tbody><tr><td valign="bottom" width="44" nowrap="true"><div><b>Size</b></div></td><td valign="bottom" width="64" nowrap="true"><div><b>Neck </b></div></td><td valign="bottom" width="64" nowrap="true"><div><b>Girth</b></div></td></tr><tr><td valign="bottom" width="44" nowrap="true"><div>S</div></td><td valign="bottom" width="64" nowrap="true"><div>6-10</div></td><td valign="bottom" width="64" nowrap="true"><div>10-15</div></td></tr><tr><td valign="bottom" width="44" nowrap="true"><div>M</div></td><td valign="bottom" width="64" nowrap="true"><div>9-13</div></td><td valign="bottom" width="64" nowrap="true"><div>14-19</div></td></tr><tr><td valign="bottom" width="44" nowrap="true"><div>L</div></td><td valign="bottom" width="64" nowrap="true"><div>12-20</div></td><td valign="bottom" width="64" nowrap="true"><div>18-26</div></td></tr></tbody></table></p>', 'DG-Classic-Harness.JPG', 'Collar.Harness.Lead', 0, 5.8, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(50, NULL, '044110', 'Polka Dot Collar', 'Cute and simple, the polka dot collar and leash are great for the most precious girl.  Polka dotted design enhanced with bowtie. ', 'polka-dot-collar-20.jpg', 'Collar.Harness.Lead', 0, 5.2, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(51, NULL, '054110', 'Polka Dot Leash', 'Cute and simple, the polka dot collar and leash are great for the most precious girl.  Polka dotted design enhanced with bowtie. ', 'polka-dot-leash.jpg', 'Collar.Harness.Lead', 0, 5.95, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(52, NULL, '53120', 'PenguinDog ', '<p>Inspired by the popular SharkDog - now like to turn your pooch into the beloved penguin! Soft cotton sweatshirt with an added bowtie for the extra cuteness. </p><p>MSRP $34.00</p>', 'Penguin Dog Sweatshirt (dog)1.jpg', 'Special FUN Wear', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(53, NULL, '53130', 'Pumpkin Sweatshirt', '<p>The light weight cotton Pumpkin Sweatshirt is detailed with a glittering pumpkin face patch that is sure to turn heads on Halloween night. </p><p>MSRP $35.00</p>', 'pumpkin-with-dog-1.jpg', 'Special FUN Wear', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(54, NULL, '042310', 'Doggie Bling Collar', '<p>Genuine leather collar and leash decorated with multiple rhinestone bling dogs - highly detailed and uses only the best metal hardware. </p><p><table style="WIDTH: 134pt; BORDER-COLLAPSE: collapse" border="0" cellspacing="0" cellpadding="0" width="178"><tbody><tr style="HEIGHT: 12.75pt; mso-yfti-firstrow: yes; mso-yfti-irow: 0" height="17"><td style="WIDTH: 61pt" class="xl24" width="81">Neck</td><td style="WIDTH: 44pt" class="xl24" width="58">Width</td></tr><tr style="HEIGHT: 12.75pt; mso-yfti-irow: 1" height="17"><td style="WIDTH: 29pt; HEIGHT: 12.75pt" class="xl26" height="17" width="39">XS</td><td style="WIDTH: 61pt" class="xl25" width="81">7 - 9.5</td><td style="WIDTH: 44pt" class="xl25" width="58">1/2</td></tr><tr style="HEIGHT: 12.75pt; mso-yfti-irow: 2" height="17"><td style="WIDTH: 29pt; HEIGHT: 12.75pt" class="xl26" height="17" width="39">S</td><td style="WIDTH: 61pt" class="xl25" width="81">9 - 12</td><td style="WIDTH: 44pt" class="xl25" width="58">1/2</td></tr><tr style="HEIGHT: 12.75pt; mso-yfti-irow: 3" height="17"><td style="WIDTH: 29pt; HEIGHT: 12.75pt" class="xl26" height="17" width="39">M</td><td style="WIDTH: 61pt" class="xl25" width="81">11.5 - 14.5</td><td style="WIDTH: 44pt" class="xl25" width="58">3/4</td></tr><tr style="HEIGHT: 12.75pt; mso-yfti-irow: 4" height="17"><td style="WIDTH: 29pt; HEIGHT: 12.75pt" class="xl26" height="17" width="39">L</td><td style="WIDTH: 61pt" class="xl25" width="81">14 - 18</td><td style="WIDTH: 44pt" class="xl25" width="58">3/4</td></tr><tr style="HEIGHT: 12.75pt; mso-yfti-irow: 5; mso-yfti-lastrow: yes" height="17"><td style="WIDTH: 29pt; HEIGHT: 12.75pt" class="xl26" height="17" width="39">XL</td><td style="WIDTH: 61pt" class="xl25" width="81">17.5 - 21.5</td><td style="WIDTH: 44pt" class="xl25" width="58">3/4</td></tr></tbody></table></p>', 'Doggie Bling Collar.jpg', 'Collar.Harness.Lead', 0, 7.6, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(55, NULL, '052310', 'Doggie Bling Leash', 'Genuine leather collar and leash decorated with multiple rhinestone bling dogs - highly detailed and uses only the best metal hardware.  \r\n\r\n4 Feet long. ', 'Doggie-Bling-Leash-PK.jpg', 'Collar.Harness.Lead', 0, 7.6, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(56, NULL, '57021', 'Scarf Sweater Cashmere', '\r\n<p>The popular scarf sweater is now made of cashmere! The simple, yet elegant sweater featuring turtle neck and a matching scarf is now softer and warmer than ever. </p><p>MSRP $35.00</p>\r\n', 'Scarf Sweater Cashmere PK(dog).jpg', 'Sweaters', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(57, NULL, '24510', 'Preppy Pooch Dress', '\r\nLooking for the back school look? Featuring a removable skirt, the top sweater can be worn alone or matched to become a preppy dress. Be the number #1 student in class!\r\n', 'preppy pooch dress dog 1.jpg', 'Charms', 0, 12, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(58, NULL, '83112', 'Raining Day Safer v.2', '<p>New and improved! By using Velcro straps on the side, this raincoat fits easy and covers top and bottom. Reflector lines bring extra safety at night. A convenient leash whole keeps harness or collar hidden and dry. </p><p>MSRP $32.00</p>', 'raining day safer V2 dog 1.jpg', 'Raincoats', 0, 12.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(59, NULL, '57030', 'Sweater Coat', '\r\nMade with soft cashmere - featuring distinctive stripes at belt, shoulder, and turtle neck - the sweater mimics the classic coat look with a modern twist. \r\n', 'Sweater Coat Cashmere (dog).jpg', 'Sweaters', 0, 16, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(60, NULL, '57040', 'Foxy Scarf Sweater', 'Keep you pooch warm in the Foxy Scarf Cashmere sweater. One of a kind checker pattern around the collar that also extends as an attached scarf to create a hip glamorous look. ', 'Foxy Scarf Cashmere GN(dog).jpg', 'Sweaters', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:23', '2014-07-17 06:36:23'),
(61, NULL, '53210', 'Fuzzy heart Sweatshirt', 'The mix of soft cotton sweatshirt halved with sweater heart pattern in the middle gives it truly unique look.  Great for all occasions, especially festive holiday season.  ', 'Fuzzy-Heart-(dog).jpg', 'Sweatshirt & Jumper', 0, 12, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(62, NULL, '77110', 'Pocket Parka', '\r\n<p>A fashionable parka for the wintry weather. Details include faux fur trimmed hood, mock-neck sweater collar, fleece lining, Velcro closure, leash hole, and a cute removable pocket. </p><p>MSRP $45.00</p>\r\n\r\n\r\n', 'pocket-parka-bl-dog-1.jpg', 'Winter Coats', 0, 18, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(63, NULL, '57050', 'Hoodie Cable Coat Cashmere ', '<p>Cable knit rich texture, classic buttons, and added hood gives this elegant cashmere coat a trendy twist. </p><p>MSRP $40.00</p>', 'cable hoodie sweater BG dog.jpg', 'Sweaters', 0, 15, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(64, NULL, '08050', 'EasyGo Sports', '<p>Sporty looking gray step-in EasyGo with orange, green, blue, or red patch. </p><p>MSRP $22.00</p>', 'sports easygo OR and Gn.jpg', 'EasyGO Harness', 0, 8.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(65, NULL, '08060', 'EasyGo Flash', 'The popular EasyGo Harness now in the perfect everyday puffer style! Fleece lining, extended neck collar, and added reflector makes this the must have winter accessory! ', 'dogo winter flash easygo.jpg', 'EasyGO Harness', 0, 10.8, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(66, NULL, '08070', 'EasyGo Winter Skull', 'We love everything furry so why not the EasyGo!  Faux fur lining keeps your pooch warm and stylish through out the winter.  ', 'dogo-winter-skull-easygo.jpg', 'EasyGO Harness', 0, 11.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(67, NULL, '08080', 'EasyGO PolkaDot', '<p>Lively colored polka dot with decorative cotton knit pom-pom. </p><p>MSRP $27.00</p>', 'Polka Dot Easygo.jpg', 'EasyGO Harness', 0, 10.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(68, NULL, '21630', 'Rhinestone Butterfly Dress', 'Studded rhinestone butterfly design and imprint butterfly skirt and sleeves.  If the dress doesn''t turn eyes the bling bling sure well.  ', 'Rhinestone-Butterfly-dress-.JPG', 'Dresses', 0, 8.95, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(69, NULL, '14610', 'Necktie Tank', '<p>The ultimate hip GQ look. Features a semi-detached tie and matching trim. 100% cotton.</p><p>MSRP $22.00</p><p />', 'necktie-tank-bk-dog-40.jpg', 'Tanks & Shirts', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(70, NULL, '21720', 'Lovely Dot Dress', '<p>A chic sports dress features polka dot top and short white skirt topped with a knot. 100% cotton. </p><p>MSRP $24.00</p>', 'Lovely Dot Dress dog.jpg', 'Dresses', 0, 9.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(71, NULL, '13310', 'Dog Go Green', '<p>Show your support for a cleaner environment! Short sleeved tee featuring cute and statment making dog graphic. Organic cotton. </p><p>MSRP $22.00</p>', 'Dog Go Green Tee dog.jpg', 'Tanks & Shirts', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(72, NULL, '21120', 'Polka Dot Ruffle Dress', '<p>Highly detailed. Features polka dot and clear stripe pattern. Ruffle trim and butterfly knot. </p><p>MSRP $22.00</p>', 'polka dot ruffle dress dog.jpg', 'Dresses', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(73, NULL, '83320', 'Pocket Raincoat V2', '<p>Simple and easy to wear raincoat that provides shoulder and chest coverage. Velcro closure. Fold in pouch design for easy carrying. </p><p>MSRP $32.00</p>', 'pocket-raincoat-red-dog-2.jpg', 'Raincoats', 0, 12.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(74, NULL, '81110', 'Rain Jumper', '<p>Full coverage from chest to all four legs. Reflective safety stripes. Fold in pouch design for easy carrying. This is the most complete raincoat. </p><p>MSRP $33.00</p>', 'Rain Jumper dog.jpg', 'Raincoats', 0, 13.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(75, NULL, '08220', 'ActiveGO Bone', 'Classic easy to wear soft harness with one click buckle. Adjustable neck and girth nylon straps. <font color="#ff99ff"><a href="/frame_showone_al.asp?pid=786&rootid=2&id=40">Matching lead is available</a></font>. ', 'activego-bone-harness.jpg', 'ActiveGO Harness', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(76, NULL, '08210', 'ActiveGO Polka Dot', 'Easy to wear soft harness with one click buckle. Adjustable neck and girth nylon straps. Hip polka dot design. Matching lead sold seperately. ', 'ActiveGO Polka dot with leash.jpg', 'ActiveGO Harness', 0, 9.25, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(77, NULL, '04030', 'ActiveGO Polka Dot Lead', '<span style="WIDOWS: 2; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 12px/22px arial; WHITE-SPACE: normal; ORPHANS: 2; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">Matching lead for ActiveGO Polka Dot Harness. Measures 4ft long and 3/5 inche wide. Metal hardware.</span> ', 'ActiveGO Polkadot leash.jpg', 'ActiveGO Harness', 0, 4.25, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(78, NULL, '08090', 'EasyGo Baseball', 'Gear up for Americas favorite pastime with the Baseball EasyGoes! ', 'EasyGO Baseball .jpg', 'EasyGO Harness', 0, 11.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(79, NULL, '021410', 'iCool Mat', '\r\n<p>Keep your dog cool all summer long. High water absorbing polymer creates a soft, cool, gel-like mat that stays cool in spite of body or room temperature. </p>\r\n<p>Size small: 18.5 x 14.5<br />Size medium: 22 x 18 </p>\r\n', 'icool-mat-20.jpg', 'iCool Collection', 0, 11.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(80, NULL, '091020', 'DOGO Waterbowl', '<p>This on the go water bowl features fold in design which makes it easy and fast to use. </p><p>MSRP $11.00</p>', 'waterbowl 10.jpg', 'Travel Accessories', 0, 4.75, 0, 0, 0, 0, 0, '2014-07-17 06:36:24', '2014-07-17 06:36:24'),
(81, NULL, '071310', 'Messenger Bag', '\r\n<p>Made of strong preshrunk cotton, this messenger bag features over the top opening, side pocket for your stuff, adjustable shoulder strap, and stylish vitalization holes. Bag measures about 15x5x8 inches. Fits up to 9lb dog. </p><p>MSRP $62.00</p>\r\n', 'messenger bag brown.jpg', 'Carriers', 0, 28, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(82, NULL, '071210', 'Nautical Tote', '\r\n<p>Navy blue stripe design, featuring zipper top closure, mesh windows with folding cover, softly padded walls, double shoulder strap, and five pockets for all your stuff. Measuring 17x8x13 inches, this carrier can fit up to a 15lb dog. </p><p>MSRP $65.00</p>\r\n', 'Nautical Stripes Tote.jpg', 'Carriers', 0, 31, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(83, NULL, 'P7310', 'PP Gemini Vest', '<p>Like the astrological sign, the Gemini vest is a two-in-one that can be worn reversibly. On one side is the corduroy fabric, and the other is faux suede. For the indecisive minds, Velcro straps will allow for easy change. </p><p>MSRP $28.00</p><p>Simply pair up the Gemini Vest with the <a href="http://www.dogodesign.com/frame_showone_al.asp?pid=560&rootid=1&id=16"><font color="#e65de6">PP Turtle Neck</font></a> for extra warmth and the ultimate chic look. </p>', 'Gemini Vest PK (dog)2.jpg', 'Winter Coats', 0, 11, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(84, NULL, 'P7110', 'PP Sports Parka', 'Kep your dog warm and active. Velcro closure from nect to stomach. Fleece inside and water resistant outside. This is the practical fashion coat to have. ', 'pp sports parka green dog.jpg', 'Winter Coats', 0, 9.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(85, NULL, 'P7210', 'PP Furry Toggle ', '\r\nLooking for a classic winter coat? Made with suede fabric and decorated with toggle and faux shearling, the Furry Toggle Coat is an everyday coat that will keep your dog warm and stylish. Velcro closure and leash whole adds ease and convenience. \r\n', 'Furry-Toggle-Coat-bk(dog).jpg', 'Winter Coats', 0, 12.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(86, NULL, 'P7410', 'PP K9 Track Jacket', '\r\n<p>Every dog has a little athlete in it, so it is only proper to equip the little champ with the proper work out track jacket. Made with fleece, detailed with K9 patch, and easy to wear back ziper enclosure. </p><p>MSRP $20.00</p>\r\n\r\n', 'K9 Track Jacket BL (dog)0.jpg', 'Winter Coats', 0, 10.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(87, NULL, 'P4010', 'PP Terry Hoody Jumper', '\r\n<p>Made with comfy terry in an athletic jog suit style. Velcro closrure and leash hole makes this jumber so easy to wear. <br />Note: the back leg length of the actual product has been shorten. </p><p>July 4th Special. Sale ends 7.6.14</p>\r\n', 'terry-jumper-dog-10.jpg', 'Sweatshirt & Jumper', 0, 12, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(88, NULL, 'P5130', 'PP Stripe Polo', '\r\n<p>Colorful stipes turn the classic polo into a trendy hit. The 100% cotton shirts are great for all occasions.</p><p>MSRP $19.00</p>\r\n\r\n\r\n', 'stripe-polo-shirt-bl-dog-20.jpg', 'Tanks & Shirts', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(89, NULL, 'P5420', 'PP Athlete Tank', 'Athletic for all active dogs. Features double stripes on each side and a matching wristband. 100% elastic cotton. ', 'PP-Athlete-Tank-dog.jpg', 'Tanks & Shirts', 0, 6.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(90, NULL, 'P9210', 'PP Turtleneck', 'Features round off turtle neck collar, leash hole, and three designer color combinations, the PP Turtlenecks are what you have been looking for. ', 'PP Stripe Turtleneck PK (dog).jpg', 'Sweaters', 0, 8.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(91, NULL, 'P5360', 'PP Rainbow Tank', '\r\nRainbow stripped with thin glitter lines. 100% cotton, leash hole. \r\n', 'Rainbow tank dog.jpg', 'Tanks & Shirts', 0, 8.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
