(95, NULL, 'P01020', 'Bone Ball', '\r\nHandmade interlaced cotton thread, designed to be flexible, durable, and improves dental health by removing deposits of calculus. Add all that with a squeaky inside means to hours of fun! Measures about 3 inches in diameter.\r\n', 'Bone-Balls.jpg', 'PAWer Squeaky', 0, 4.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(96, NULL, '08010', 'EasyGo Camo', '\r\n\r\nDOGO EasyGo Harness is the best all in one step in harness. It is easy to wear and comfortable on the dog. Unlike other mesh harnesses that use Velcro straps on the lower chest, which loosen its grip overtime, EasyGo Harness step-in design is tightened from the back. This allows much greater security as harder the dog pulls the tighter it gets. Matching lead is included with the harness! \r\n\r\n', 'easygo-basic-camo-camo-pk.jpg', 'EasyGO Harness', 0, 8.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(97, NULL, 'P5350', 'PP Rock Star Tank', 'Silver electric guitar print on a sleeveless tank. Party like a rock star! 100% cotton. ', 'pp-rock-star-pink-dog0.jpg', 'Tanks & Shirts', 0, 6.7, 0, 0, 0, 0, 0, '2014-07-17 06:36:25', '2014-07-17 06:36:25'),
(98, NULL, 'P9110', 'PP Animal Hoody', '\r\nPullover sweater features animal like ears on hood, and two small pocket design.  Leash hole, acrylic.  \r\n', 'animal-sweater-green-dog.jpg', 'Sweaters', 0, 8.99, 0, 0, 0, 0, 0, '2014-07-17 06:36:26', '2014-07-17 06:36:25'),
(99, NULL, 'P2310', 'PP Graphic Tank Crown', 'The light summery tank offers multi-color shoulder straps and a crown imprint. 100% cotton. ', 'graphic-tshirt-dress-crown-dog-2.jpg', 'Tanks & Shirts', 0, 4.85, 0, 0, 0, 0, 0, '2014-07-17 06:36:26', '2014-07-17 06:36:26'),
