(248, NULL, '08660', 'EasyGO Argyle', '<p>Step-in EasyGO with light argyle pattern.</p><p>MSRP $28.00</p>', 'easygo-argyle.jpg', 'EasyGO Harness', 0, 11, 0, 0, 0, 0, 0, '2014-07-17 06:36:34', '2014-07-17 06:36:34'),
(249, NULL, '071013', 'DOGO Sports Bag Black', '<p>Sporty style dog carrier with dual mesh panels on each side, with one also acting as a door. Constructed with water resistant material on the exterior, this bag is lightweight and ideal for pets 10lbs and under. Other features include padded strap for shoulder comfort, security leash inside the carrier, and a reflector strip on the exterior for your pet''s safety</p><p>Size: 15.5''''L x 6.5''''W x 9.5''''H.</p><p>MSRP $59.00</p>', 'dogo-sports-bag-bk.jpg', 'Carriers', 0, 24, 0, 0, 0, 0, 0, '2014-07-17 06:36:34', '2014-07-17 06:36:34'),
(250, NULL, '021500', 'CozyCloud Memory Bed', '\r\n<p>Enjoy the highest quality sleep everyday and night.</p><ul><li>100% 3 inches of memory foam</li><li>Waterproof liner keeps say liquid, stains, odors, and allergens</li><li>Non-Slip grid bttom design for tile and hardwood floors </li><li>Removable and washable designer covers</li><li>23&quot; L x 18.5&quot; W x 3&quot; H</li></ul><p>This is a complete CozyCloud Memory Foam Bed system wich includes the mattress, waterproof liner, and a choice of cover. </p><p>Special Shipping Offer: Flat Rate $15 FedEx Ground for Bundle of 3 Beds (lower 48 States only).</p>\r\n\r\n\r\n', 'cozycloud-memory-foam-bed.jpg', 'Beds', 0, 35, 0, 0, 0, 0, 0, '2014-07-17 06:36:34', '2014-07-17 06:36:34'),
(251, NULL, '021510', 'CozyCloud Bed Covers', '\r\n<p class="MsoNormal" style="margin: 0in 0in 0pt;"><span style="font-family:;">Fits perfectly with the CozyCloud Memory Foam Beds. Change the look of your CozyCloud by simply unzipping the old cover and swap on the new one. Washable preshrunk cotton designed to be stylish and durable. No-Slip grid bottom keeps the bed from sliding on smooth flooring.</span></p><p class="MsoNormal" style="margin: 0in 0in 0pt;"><span style="font-family:;"><span style="mso-spacerun: yes;"></span></span></p><p class="MsoNormal" style="margin: 0in 0in 0pt;"><span style="font-family:;"></span></p><p>&nbsp;</p>\r\n', 'cozycloud-bed-cover-1.jpg', 'Beds', 0, 12.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:34', '2014-07-17 06:36:34'),
