(256, NULL, '53321', 'Dragon Skull ', '<p><span style="LINE-HEIGHT: 115%; FONT-FAMILY: "><font face="arial,helvetica,sans-serif"><br />Black and white dragon skull hoodie featuring glow in the dark skull and white plates. 100% cotton with leash hole.</font></span></p><p><span style="LINE-HEIGHT: 115%; FONT-FAMILY: "><font face="Arial">MSRP $38.00</font></span></p>', 'dragon-skull-sweatshirt-dog-10.jpg', 'Special FUN Wear', 0, 16.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(257, NULL, '53340', 'Trouble Skunk ', '\r\n<p>This cute skunk outfit features white Mohawk hood and &quot;Here Comes Trouble&quot; print. Designed to be an everyday sweatshirt made 100% cotton with convenient leash hole. </p><p>July 4th Special. Sale ends 7.6.14</p>\r\n', 'skunk-sweatshirt-dog-1.jpg', 'Special FUN Wear', 0, 16.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(258, NULL, '012170', 'Crab Hat', '<p>Wanna teach your pup a new trick? How about put the crab hat on and learn to walk sideways? Crab style hat with adjustable Velcro closure. </p><p>MSRP $16.00</p>', 'crab-hat.jpg', 'Hats & Scarf', 0, 6.95, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(259, NULL, '012180', 'Donkey Hat', '<p>Donkey designed hat featuring adjustable Velcro closure. </p><p>MSRP $16.00</p>', 'donkey-hat.jpg', 'Hats & Scarf', 0, 6.95, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(260, NULL, '36010', 'Charming Witch Dress & Hat', '<p>This spell casting witch dress features see-through lace trimmed skirt?ecorated with stars and matching witch hat. </p><p>MSRP $15.50</p>', 'charming-witch-dog-1.jpg', 'Special FUN Wear', 0, 15.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(261, NULL, '071510', 'Lux Tote', '\r\n<p>Luxurious tote made with high quality pleather and hardware. Accented with metal hearts, black and white zebra lining. Opening from top and side with additional layer of mesh window for ventalization. Two functional side pockets for all your stuff and an inner lead for security. </p><p>15L x 7W x 11H (inches)</p>\r\n', 'Lux Pleather Tote.jpg', 'Carriers', 0, 34, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(262, NULL, '57720', 'Classic Cable Sweater', '\r\n<p>Classic pullover turtleneck cable knit sweater with functional two-button placket, and faux shearling around inner collar.</p><p><br /></p><p>MSRP 36.00</p><p>&nbsp;</p>\r\n', 'classic-cable-sweater-bl-dog-3.jpg', 'Sweaters', 0, 15, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(263, NULL, '57620', 'Sporty Stripe Sweater', '\r\n<p>Sports looking pullover striped turtleneck sweater with a functional zipper placket and a convenient leash hole. </p><p><br /></p><p>MSRP 36.00</p>\r\n\r\n', 'sporty-stripe-sweater-bg-dog-2.jpg', 'Sweaters', 0, 15, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(264, NULL, '26090', 'Ruffle Tiered Sweater Dress', '\r\n<p>Who said we can''t party like a diva in winter. Show and flare, this multi ruffled tiered sweater accented with a cute bowtie will sure turn heads. </p><p><br /></p><p>MSRP $36.00</p>\r\n', 'ruffle-tiered-sweater-dress-dog-1.jpg', 'Charms', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(265, NULL, '58510', 'Colorful Stripe Sweater', '\r\n<p>Short turtleneck pullover with multi colored stripes and off white base gives it a light modern look. Leash hole below collar.</p><p>MSRP $35.00</p>\r\n', 'colorful-stripe-sweater-pk-dog-1.jpg', 'Sweaters', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(266, NULL, '26080', 'School Girl Sweater Dress', '\r\n<p>If classy and preppy is your style be sure to go to class with this pullover knit sweater dress featuring navy/white trim, and ruffle short skirt. Leash hole below collar. </p><p><br /></p><p>MSRP $36.00</p>\r\n', 'school-girl-sweater-dress-dog-1.jpg', 'Charms', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(267, NULL, '76010', 'Military Shearling Harness Coat', '\r\n<p>A new twist to a classic faux suede and shearling coat. Designed to be used as a harness, it features adjustable double nylon and buckle around the neck and stomach. Reflector stripes and heavy D-ring add to safety and style.</p><p>MSRP $46.00</p>\r\n\r\n', 'military-harness-coat-bn-dog-1.jpg', 'Harness Vest', 0, 18.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(268, NULL, '76110', 'Wintersnow Harness Coat', '\r\n<p>Active winter harness coat featuring Velcro closure with adjustable double nylon strap and buckle. Water resistance outer, padded warm fleece, and a removable hat. Reflector stripes and heavy D-ring add to safety and style.</p><p>MSRP $46.00</p>\r\n\r\n', 'wintersnow-harness-coat-bl-dog-3.jpg', 'Harness Vest', 0, 18.5, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
(269, NULL, '53060', 'Football Sweatshirt', '\r\n<p>Show you pride in the all american sport. Everyday varisty style hoodie made of 100% cotton featuring glow in the dark foot ball decal and sweater lining hood. Convenient leash hole right below hood. </p><p>MSRP 34.00</p>\r\n', 'football-sweatshirt-dog-1.jpg', 'Sweatshirt & Jumper', 0, 14, 0, 0, 0, 0, 0, '2014-07-17 06:36:35', '2014-07-17 06:36:35'),
