(282, NULL, '33410', 'iCool Vest', '\r\n\r\n<p>Keep you pet cool from the heat!</p><ul><li>Water cooled material</li><li>Dog stays dry</li><li>No refrigeration needed</li><li>Lightweight</li></ul>How to use: <div>1. Soak iCool Vest by placing it in a basin with cold water until it is completely wet.</div><div>2. Gently wring out excess water to avoid dripping.</div><div>3. For continuous use, repeat above steps.</div><div><br /><a href="http://www.dogopet.com/v/vspfiles/assets/popuphtml/icoovest1.jpg" target="_blank"><strong>Click here for more info</strong></a></div><div></div><div>MSRP $39.00</div><div></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'icool-vest-boston-1.jpg', 'iCool Collection', 0, 17, 0, 0, 0, 0, 0, '2014-07-17 06:36:36', '2014-07-17 06:36:36'),
(283, NULL, '021230', 'Burger Bed Pink', '<p>Cuddle your pet in the designer styled Burger Bed. It is soft, cozy, and gives a sense of security unlike any other beds. Base diameter measures 22 inches. Dog in picture weights 11lb. </p>', 'burger-bed-pink-1.jpg', 'Beds', 0, 27, 0, 0, 0, 0, 0, '2014-07-17 06:36:36', '2014-07-17 06:36:36'),
