(328, NULL, 'P01022', 'Rainbow Ball', '<p>\r\n\r\nRainbow designed dog crochet toy ball. </p><p>Hand made interlace cotton thread, designed to be flexible, durable, and improves dental health by removing deposits of calculus. Add all that with a squeaky inside means hours of fun! Measures about 3 inches in diameter.</p>', 'toy-rainbow-ball-1.jpg', 'PAWer Squeaky', 0, 4.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(329, NULL, '14630', 'Backpack Tank', '\r\n\r\nVertical green and white stripes featuring a stitched on functional little pocket back pack enclosed with a name tag. 100% stretch cotton with leash hole.\r\n', 'backpack-tank-dog-10.jpg', 'Tanks & Shirts', 0, 11, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(330, NULL, 'P5135', 'PP Stripe Polo New Color', '\r\n\r\nNew Blue and Yellow stripes. Colorful stripes turn the classic polo into a trendy hit. The 100% cotton shirts are great for all occasions.\r\n', 'stripe-polo-shirt-bl-yw-dog-1.jpg', 'Tanks & Shirts', 0, 8.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(331, NULL, '83140', 'Bunny Raincoat', '\r\n\r\nWater proof raincoat with highly detailed bunny hood. Easy to wear wit side Velcro and front chest coverage.', 'bunny-raincoat-dog-2.jpg', 'Raincoats', 0, 14.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(332, NULL, '058312', 'EasyCLICK Leash Stripes', '\r\n<p>\r\n\r\nMatching Leash?for EasyCLICK Harness Stripes.</p><p>Measurement: 5 feet long.</p>\r\n', 'easyclick-lead-stripe-blyw-1.jpg', 'Collar.Harness.Lead', 0, 4, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(333, NULL, '058320', 'EasyCLICK Leash Fun Stripes', '\r\n<p>\r\n\r\nMatching leash for?EasyCLICK Harness Fun Stripes.</p><p>Measurement: 5 feet long.</p>\r\n\r\n\r\n', 'easyclick-lead-fun-stripe-rd-2.jpg', 'Collar.Harness.Lead', 0, 4, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(334, NULL, '058330', 'EasyCLICK Leash Polka Dots', '\r\n<p>\r\n\r\nMatching leash?for EasyCLICK Harness Polka Dots.</p><p>Measurement: 5 feet long.</p>\r\n\r\n', 'easyclick-lead-polka-dot-pk-1.jpg', 'Collar.Harness.Lead', 0, 4, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(335, NULL, '11210', 'K9 Patch Polo', '\r\n\r\nRed, white and blue polo shirt featuring a K9 badge patch. 100% stretch cotton with convenient leash hole.', 'k9-polo-shirt-dog-3.jpg', 'Tanks & Shirts', 0, 9.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(336, NULL, '14125', 'Whale Tank', '\r\n\r\nMulti blue striped tank with an adorable whale embroidered patch. 100% stretch cotton with convenient leash hole.', 'whale-tank-dog-1.jpg', 'Tanks & Shirts', 0, 9.95, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(337, NULL, '21450', 'Dot N Ruffle Dress', '\r\n\r\nBright and princess style look, featuring a polka dot pattern with pretty ruffles, complete with sweet pink bow, sure to be the center of attention. Stretch cotton with leash hole.', 'dot-n-ruffle-dress-dog-1.jpg', 'Dresses', 0, 11, 0, 0, 1, 0, 0, '2014-07-17 06:36:39', '2014-07-17 06:36:39'),
(338, NULL, '21460', 'Hippie Country Plaid Dress', '\r\n\r\nThis style features a bright red plaid flowy skirt, with matching red buttons that resembling overalls for a sweet country style look. 100% cotton. Leash hole.', 'hippie-country-plaid-dress-dog-1R.jpg', 'Dresses', 0, 11, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(339, NULL, '37020', 'Easy-D Bow Dot Dress', '\r\n\r\nThis unique collection features a fresh new design, combining the functions of a harness with trendy styles. Each style has a strong Velcro fastening across the chest and belly which makes them very comfortable to wear, as well as easy to remove. D ring attachment on the outside allows for simple link or removal of the leash.\r\n', 'easy-d-bow-dot-dress-dog-1.jpg', 'Dresses', 0, 12.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(340, NULL, '37030', 'Easy-D Bling Dress', '\r\nThis unique collection features a fresh new design, combining the functions of a harness with trendy styles. Each style has a strong Velcro fastening across the chest and belly which makes them very comfortable to wear, as well as easy to remove. D ring attachment on the outside allows for simple link or removal of the leash. \r\n\r\n\r\n', 'easy-d-bling-dress-dog-1.jpg', 'Dresses', 0, 12.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(341, NULL, '37010', 'Easy-D Sailor Vest', '\r\n\r\nThis unique collection features a fresh new design, combining the functions of a harness with trendy styles. Each style has a strong Velcro fastening across the chest and belly which makes them very comfortable to wear, as well as easy to remove. D ring attachment on the outside allows for simple link or removal of the leash. ', 'easy-d-sailor-vest-dog-3.jpg', 'Tanks & Shirts', 0, 11.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(342, NULL, '08720', 'EasyGO Polo', '\r\n\r\nStep-in EasyGO harness with striped polo inspired design. Leash included.\r\n', 'easygo-polo-1.jpg', 'EasyGO Harness', 0, 12.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(343, NULL, '08710', 'EasyGO Bowtie', '<p>Step-in EasyGO harness with classy red bowtie and tuxedo vest inspired design. Leash included.</p>', 'easygo-bowtie-10.jpg', 'EasyGO Harness', 0, 13.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(344, NULL, '08730', 'EasyGO Sequins', '\r\n\r\n\r\nStep-in EasyGO harness with sequins and flashy bowtie. Leash included.\r\n\r\n', 'easygo-sequin-1.jpg', 'EasyGO Harness', 0, 12.5, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(345, NULL, '21770', 'Nautical Stripe Dress', '\r\n\r\nVery charming and stylish. Bright red stripes with complimenting blue waistband. Stylish neckerchief and eye catching flashy anchor patch on the back. 100% cotton with leash hole.', 'nautical-stripe-dress-dog-1.jpg', 'Dresses', 0, 11, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(346, NULL, '071510', 'Lux Tote Imperfect Condition', '\r\n<font face="arial,helvetica,sans-serif" size="2">Lux Pleather Tote with some faulty production for sale. Please see description and picture for detail.<span class="Apple-converted-space">&nbsp;</span>ALL SALES ARE FINAL.</font><p style="color: rgb(0, 0, 0); text-transform: none; line-height: normal; text-indent: 0px; letter-spacing: normal; font-style: normal; font-variant: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;"><font face="arial,helvetica,sans-serif" size="2">- Trimming rounding off the top of the bag is not perfectly sewn.<br />- Inner lining may come loose after use<br />- Inner Dogo label marked strikethrough or cut</font></p><p style="color: rgb(0, 0, 0); text-transform: none; line-height: normal; text-indent: 0px; letter-spacing: normal; font-style: normal; font-variant: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;"><font face="arial,helvetica,sans-serif" size="2">Luxurious tote made with high quality pleather and hardware. Accented with metal hearts, black and white zebra lining inside. Opening from top and side with additional layer of mesh window for ventilation. Two functional side pockets for your stuff.</font></p><font size="2"><strong>&nbsp;</strong>\r\n</font>\r\n\r\n', 'Lux Pleather Tote0.jpg', 'Carriers', 0, 34, 0, 0, 0, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(347, NULL, '021340', 'Burger Bed Green', '\r\n<p>\r\n\r\nCuddle your pet in the designer styled Burger Bed. It is soft, cozy and gives a sense of security unlike any other beds.?</p><p>On Backorder - ETA 8/20/14</p><p>Base diameter measures 22 inches.</p>\r\n', 'burger-bed-green-1.jpg', 'Beds', 0, 27, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(348, NULL, '021240', 'Slipper Bed ', '\r\n\r\nSuper cute slipper shaped bed. Snuggle into plush, warmth, and a sense of security all pups love. Polyester.', 'slipper-bed-bl-dog-1.jpg', 'Beds', 0, 33, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(349, NULL, '021440', 'iCool Carrier Pad', '\r\n\r\nKeep your pet cool in hot summer days. Design to fit in most carriers. Dry cooling pad, no additional water and refrigeration required.\r\nMeasures 40x18 cm (15.75 x 7 inches).\r\n\r\n\r\n', 'icool-carrier-pad-2.jpg', 'iCool Collection', 0, 8.95, 0, 0, 1, 0, 0, '2014-07-17 06:36:40', '2014-07-17 06:36:40'),
(350, NULL, '062180', 'EasyBOW Flower 3', '\r\n<p>\r\n\r\n<font face="arial,helvetica,sans-serif"><font size="2"><span style="font: 12px/normal Arial, Helvetica, sans-serif; text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; float: none; display: inline !important; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">Beautiful<span class="Apple-converted-space">&nbsp;</span></span><span style="text-align: left; color: rgb(37, 37, 37); text-transform: none; line-height: normal; text-indent: 0px; letter-spacing: normal; font-style: normal; font-variant: normal; font-weight: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">chrysanth</span><b style="text-align: left; color: rgb(37, 37, 37); text-transform: none; line-height: normal; text-indent: 0px; letter-spacing: normal; font-style: normal; font-variant: normal; word-spacing: 0px; white-space: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;"><span class="Apple-converted-space">&nbsp;</span></b><span style="text-align: left; color: rgb(0, 0, 0); text-transform: none; line-height: normal; text-indent: 0px; letter-spacing: normal; font-style: normal; font-variant: normal; font-weight: normal; word-spacing: 0px; float: none; display: inline !important; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;">flower design created to be worn on your dog''s collar and harnesses. Each bow is very simple to use and has very elegant chic design. Elastic strap with Velcro is used for adjusting and fastening.<span class="Apple-converted-space">&nbsp;</span></span></font></font></p><p><span style="font: 12px/normal Arial, Helvetica, sans-serif; text-ali